import React from 'react'

const App28 = () => {
    const data = [
        {
            name: "ASDFA",
        }
    ]
    return (
        <>
            <table border={1} align='center'>
                <tr>
                    <th>Task</th>
                    <th>Number</th>
                    <th>Status</th>
                </tr>
                {
                    data?.map((val_, ind_) => {
                        return (
                            <>
                                <tr>
                                    <th>{val_.userid}</th>
                                    <th>{val_.name}</th>
                                    <th>{val_.name}</th>
                                </tr>
                            </>
                        )
                    })
                }
            </table>
        </>
    )
}

export default App28
